import React from 'react';
import './App.css';
import Main from './components/mainpage/main';
import { BrowserRouter, Route, Switch, Link } from 'react-router-dom';
import Graphics from './components/detailpage/graphics';
import Alertform from './components/mainpage/alertform';
import AlertLinks from './components/mainpage/alertLinks';
import './main.css';



function App() {
  return (
    <BrowserRouter >
    <div >
      {/* <div className="header"  >
        <Link to={{pathname: '/alerts'} } className="baslik" >Alert System</Link>
      </div> */}
      <Switch>
        <Route path="/alerts" component={Main} exact />
        <Route path="/alerts/:name" component = {Graphics}/>
      </Switch>
      <div>         
            <div className="column side">
              <Alertform></Alertform>
            </div>
            <div className="column middle">
              <AlertLinks></AlertLinks>
            </div>
        </div>       
    </div>


  </BrowserRouter>
  );
}

export default App;
